import React from 'react'
import styled from 'styled-components'
import SearchInput from '@components/common/SearchInput'

const NavBar = styled.nav`
  width: 100%;
  padding: 20px 10px;
  background: #fbf8f5;
  position: sticky;
  top: 0;
`
const ContentWrapper = styled.div`
  display: flex;
`

const Header = () => {
  return (
    <NavBar>
      <ContentWrapper>
        <SearchInput />
      </ContentWrapper>
    </NavBar>
  )
}

export default Header
